(10799, 8727, 1239, 1, 'Intro', '', '2008-12-23 00:00:00', 0000, 25, 1, 4, '留在黃昏  輕輕挽著你手真的很暖\r\n重新開始的愛戀\r\n曾是無知  當天我沒有花很多心血\r\n而第三者靜靜來損\r\n\r\n不懂珍惜  跟你分手\r\n輾轉的走過幾段愛戀\r\n\r\n終於再遇你  始終愛著你\r\n就似注定要一起\r\n今天學會如何愛\r\n過了冬天鮮花將再開\r\n\r\n當感覺漸近  熟悉也漸滲\r\n望你會令我興奮\r\n能再一起有多美\r\n沒有顧忌今天只會想\r\n重新愛你\r\n\r\n重新愛你\r\n\r\nop Hei Wong\r\n\r\n', '', 43, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:12:36', '2015-03-12 13:35:54', '0000-00-00 00:00:00'),
