(10804, 8727, 1239, 3, '我會唱下去', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, '就這樣躺在sofa喝著cola手抱著結他\r\n就這樣寫著歌詞哼著melody經過大半天\r\n\r\n我會(讓我)繼續唱再唱再唱下去\r\n願意分享心底聲音於歌裏\r\n衷心等一天望會來臨\r\n\r\n我站在台中央\r\n有你為我鼓掌\r\n這會是我的理想\r\n真想可以\r\n就藉著我聲音\r\n去帶動你心坎\r\n到最後我在流淚\r\n若你有相信  我會唱下去\r\n\r\n重覆著不停不停不停不停的努力寫歌\r\n重覆著等待等待等待等待等開花結果\r\n\r\nwoo 你為我鼓掌\r\nwoo 我在流淚\r\n若有你相信  我會唱下去\r\nI''m not giving up\r\n\r\nop Hei Wong\r\n\r\n', '', 238, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:14:00', '2015-03-12 13:35:54', '0000-00-00 00:00:00'),
