(10806, 8727, 1239, 4, '相約夏天', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, '習慣了每一天  在等跟你再相見\r\n如果約定沒有變  跟你相約在夏天\r\n\r\n再靠近了窗邊  拿起手裡的coffee\r\n淡淡的煙蓋著我視線  思緒也聚積一片\r\n\r\n在你那邊會是寒冷飄雪穿上冬衣\r\n在我這邊只有微微的雨\r\n願我這刻能伸手把你擁抱來給你溫暖\r\n無奈我只可家裡呆坐著看雨點\r\n盼快點終於等到在仲夏那天相見\r\n(盼快點終於等到在仲夏那天  在那天相見)\r\n\r\n就在夏天\r\n\r\nop Hei Wong', '', 224, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:14:42', '2015-03-12 13:35:54', '0000-00-00 00:00:00'),
