(10808, 8727, 1239, 5, 'My Majesty', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, '為愛你我已拋開顧忌\r\n想與你  挽手一起走每一天不分離\r\n絕對相信我倆最登對\r\n下半生再過五十年仍然愛下去\r\n\r\n在今晚  微風醉\r\n留戀這  長街裏\r\n求婚戒  在手裏\r\n再問你願意下嫁給我嗎\r\nOh My Majesty\r\n你說句"我願意"好嗎\r\n若生老  病倒了\r\n或傷痛  和歡笑\r\n窮一晚  富一朝\r\n我都會在你身邊給你需要\r\nOh My Majesty\r\n若半夜惡夢扎醒  抱著你渡過深宵\r\n\r\n要帶你到天荒地老\r\n世界再改變也必須給你知道\r\n永遠是我心裏的女皇\r\n我發誓發誓效忠   發誓發誓效忠\r\n愛你愛著每一天\r\n\r\nop Hei Wong', '', 259, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:15:29', '2015-03-12 13:35:54', '0000-00-00 00:00:00'),
