(10810, 8727, 1239, 6, 'Kiss Goodnight', 'Everytime I close my eyes\r\nYou''re in my mind I can''t define \r\nWhy I break right down and cry\r\nI wonder how you''re doing now\r\nYou''re single now or hanging out with a guy\r\nWho kisses you goodnight\r\n\r\nGirl it was so bad i know i didn''t treat you right\r\nWith all the shit i put you through\r\nYou still held on tight\r\nI know for a fact that you forgave me that i lied\r\nIf there''s a way to travel back in time\r\nI''ll kiss you every night\r\nI''ll kiss you every night\r\n\r\nTry to learn from my mistakes\r\nI told myself there will be a better time\r\nBut the pain just stays inside\r\nI feel like running in the dark\r\nThere''s no way to go but i couldn''t stop\r\nUntil i see the light\r\n\r\nI''ll be there if you need me now\r\nYou just have to let me know somehow\r\n\r\nop Hei Wong', '2008-12-23 00:00:00', 0000, 25, 0, 4, '', '', 240, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:16:17', '2015-03-12 13:35:55', '0000-00-00 00:00:00'),
