(10812, 8727, 1239, 7, 'Biker', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, '著上皮褸   套上雙手\r\n整理我坐姿   I''m ready\r\n今晚要暴走   I''m born to be free\r\n\r\n不需配戴音響   排氣聲相當高漲\r\nfeel那震動感   令我興奮\r\n再感覺那陣風   無言快感\r\n現實壓力再沒有\r\n\r\n今晚我不顧一切的走\r\n走在鬧市街上巡遊\r\n電單車終生與我為友\r\n塵世很多東西看不透\r\n都已放下了   讓別人來猜夠\r\n請准我不顧一切的走\r\n管這一生到了盡頭\r\n我的心都堅決未悔疚\r\n在身邊種種私心與爭鬥\r\n都已放下了  任旁人認購\r\n我有我走\r\n\r\n轉動我自由\r\n完全地擁有\r\nIt''s a biker''s life\r\n\r\nop Hei Wong\r\n\r\n', '', 214, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:16:58', '2015-03-12 13:35:55', '0000-00-00 00:00:00'),
