(10814, 8727, 1239, 8, 'She Loves Me', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, 'She loves me, she loves me not\r\n數這花瓣   當單數會是很喜歡我\r\nShe loves me, she loves me not\r\n數這梯級   可否會說明她心中想我\r\nShe loves me, she loves me not\r\n等五分鐘   猜一下有幾班車經過\r\nShe loves me, she loves me not\r\n拋進了麼   只想要確定她今晚找我\r\n\r\n試過占星塔羅與命相\r\n我試過每天向上帝禱告\r\n我很想你喜歡我\r\n\r\nI''m loving you and will you love me too\r\n心中知道   像你這樣漂亮女生選擇有很多\r\n能住在你的心裏會是我麼\r\nI''m thinking about you and hope you feel the same way too\r\n怎麼可以   讓你在諸多位之中挑選我\r\nOh baby won''t you won''t you tell me now\r\n你為我感動過\r\n\r\nop Hei Wong\r\n\r\n', '', 275, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:17:41', '2015-03-12 13:35:55', '0000-00-00 00:00:00'),
(10815, 8727, 1239, 9, 'Everything Is ok', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, '每天早上返工返學家中一切怎處理\r\n一家討論最終決定請個賓妹返屋企\r\n說到最重要識煮幾味洗衫煲湯打掃企理\r\n就似個鎭山之寶個屋企靠晒你\r\n\r\n朝早七點早餐最緊要有新款口味\r\n八點九點十點抺抺傢俬洗洗地\r\n下晝一點午餐仔女放學會返屋企\r\n衣衫到處放仲要幫佢執手尾  辛苦你\r\n\r\nOh yeah  星期天會找找知知己\r\n總有一天盡量滿足自己\r\n去搵返一笪空地  再約晒所有鄉里\r\nOh yeah  彈結他唱歌舞再起\r\n讓你開開心心放鬆自己\r\n到聽朝早見到你  (到晚上你返屋企  到天曚光再早起  到7am見到你)\r\n你對我說 Everything''s OK\r\n\r\n下晝三點諗定今晚要煮一湯四味\r\n夠鐘去街市買定餸菜作好準備\r\n八點晚飯送上一家大細要啱口味\r\n收工洗碗洗碟再返入房冚被  辛苦你\r\n\r\n病了  怎麼  願你波士懂得關心你\r\n偶爾  思鄉  別再把心中感覺收起\r\n有你  一起  放心將家中一切也交託你  無得比\r\n\r\nop Hei Wong\r\n\r\n', '', 208, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:18:14', '2015-03-12 13:35:55', '0000-00-00 00:00:00'),
(10816, 8727, 1239, 10, '十年', '再記起當天你在動物店\r\n長長耳朵  身軀多細小\r\n帶你到公園散步跑兩轉\r\n莫論晴天雨天陰天\r\n\r\n當開心高興你便會擺著尾巴  匆匆跑到身邊說"好嗎?"\r\n當傷心失意你便會安慰著我  你說"這世上還有我待你好."\r\n\r\n我與你每一天漸漸成長\r\n日復日變遷  已有十年\r\n到了最終要注定離去\r\n而你永遠活在我心裏\r\n\r\nop Hei Wong', '2008-12-23 00:00:00', 0000, 25, 0, 4, '', '', 268, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:18:51', '2015-03-12 13:35:55', '0000-00-00 00:00:00'),
(10817, 8727, 1239, 11, '不知不覺喜歡你', '', '2008-12-23 00:00:00', 0000, 25, 0, 4, '過了3300秒\r\n仍沒法調查到為何暗裏著緊你\r\n自知我今次不爭氣\r\n\r\n說過7700次\r\n明白嗎是朋友極其會變作知己\r\n怎想到終會產生改變\r\n\r\n直到他  斗膽暗裡約會你\r\n直到他  weekend帶你去睇戲\r\n然後再  再送你返屋企\r\n\r\n摑了我咀巴跟你說對不起\r\n是我不知不覺間喜歡(你)\r\n豁了我放膽跟你說對不起\r\n事實我不知不覺間喜歡你\r\n\r\n不再自欺\r\n\r\n過去太多不滿意\r\n你想嗎可以嗎從頭嚟過再一次\r\n抱擁我心中的天使\r\n你要什麼都可以\r\n你想A你想B你想CDEFG\r\n修補最初真的我願意\r\n\r\n在每朝  決定快快再會你\r\n在晚間  即管約你去睇戲\r\n然後再  再送你返屋企\r\n\r\n很喜歡你\r\n我的心向著你  我的心向著你\r\n\r\nop Hei Wong\r\n\r\n', '', 238, '', '黃湛熙', '黃湛熙', '黃湛熙', '', '', 1, 1, 0, '2008-12-23 15:19:26', '2015-03-12 13:35:55', '0000-00-00 00:00:00'),
