(10921, 8749, 2500, 1, 'Alien Avenge 鎮魂', '', '2009-08-01 00:00:00', 0000, 25, 0, 9, 'Alien Avenge 鎮魂\r\n\r\n荒地   草木不生\r\n萬物   意志消沉\r\n八方流竄的亡魂  盲目  迷失方向  挑撥紛爭\r\n\r\n自恃   劃地為王\r\n仰首   不可一世\r\n夜郎自大的亡魂  悲哀  原地躊躇  雙瞳模糊\r\n\r\nIt’s  unable  to  endure\r\n\r\n惡鬥   重蹈覆轍\r\n魂破   正氣裂\r\n苟延殘喘的亡魂  憤世  手刃刀舞  血濺四處\r\n\r\n霸氣   異族重生\r\n嘯吼   鎮魂威\r\n狂傲不羈的亡魂  震怒  毫無讓步  殺出血路\r\n\r\n喂   異族的亡靈\r\n踏越殘破的屍體\r\nI roar therefore I am\r\n揮舞鎮魂的招旗\r\n\r\n喂   兇悍的亡靈\r\n忘卻生前的記憶\r\nI roar therefore I am\r\n重建渾沌的秩序\r\n', '', 249, '', 'Alien Avenge ', 'Alien Avenge ', 'Alien Avenge ', '', '', 1, 1, 0, '2008-12-24 02:42:16', '2015-03-12 13:35:58', '0000-00-00 00:00:00'),
(10922, 8749, 2500, 2, 'Alien Avenge The lock', '', '2009-08-01 00:00:00', 0000, 25, 0, 9, 'Alien Avenge The lock\r\n\r\nThe Lock\r\nCan''t hear    any sound\r\nCan''t see     any thing\r\nThe air       swallows me\r\nBody is where      un culti vation \r\n\r\nMy hands     can''t move\r\nMy foots      is unable\r\nThe heart      without the rule\r\nImprisoned in the      state which does''t have\r\n\r\nLock my thought    Lock my motion     Con fuses my at present all\r\n\r\nRaging fire     is burning\r\nCold wind      is freezing\r\nIn the          pur ga tory\r\nLoses the direction     had not hoped\r\n\r\nExile       in darkness\r\nImpression   Is sealed up\r\nTime not     in rotation\r\nThe ray no longer         reappears in the life\r\n\r\nLock my thought    Lock my motion     Con fuses my at present all\r\n\r\nI want free   I need Breath  Leads me leave     Otherwise I am rather   die\r\n\r\nIt’s fucking lie  Only to deceive   the people to this door in\r\nLet   you   but   cher\r\n\r\nFucking lie   Has not said enough\r\nMust want the rivers of blood   Sores all over the eye  only then sa tis fy\r\n\r\nNow you are full of the power\r\nI can’t see the light   Form the window\r\n\r\nDon’t try to let me in mad\r\nI can’t hear the sound  Form the window\r\n', '', 263, '', 'Alien Avenge ', 'Alien Avenge ', 'Alien Avenge ', '', '', 1, 1, 0, '2008-12-24 02:46:13', '2015-03-12 13:35:59', '0000-00-00 00:00:00'),
(10923, 181, 1253, 1, '天堂Ⅱ舞曲 - 渾沌的年代 [Lineage Ⅱ - The Chaotic Chronicle]', '知名韓國遊戲開發廠商NC大手筆的開發全3D畫面在當時引起不少震撼，華麗的背景世界以及人物的外貌吸引很多玩家們投入當時網路世界遊戲中全勝的戰局冠軍，當然凱斯也是當時的死忠遊戲玩家！\r\n\r\n凱斯電玩音樂作品中的天堂（前一代）舞曲系列，受到許多熱愛天堂的玩家們支持與喜愛，凱斯也將天堂2遊戲再造另一個電子音樂新曲目，由於玩過此款遊戲對遊戲內容背景有更深一層了解而開始規劃出30等級至40等級路線為設定中心，因為沒辦法擷取遊戲中音訊檔，所以在遊戲音效錄製過程中全部以手工方式一步一步收錄，在這一路上錄製非常辛苦，吃了不少靈魂彈、人物死了不少次、掉了很多趴、走遍不少遊戲地區…等等，雖過程辛苦但還是完成了！也謝謝當時盟友協助我完成這些問題，也謝謝我的女性朋友特別為我抽空時間的協助配唱。\r\n\r\n作品年份：2004/03\r\n更多凱斯音樂請至：http://www.kevinsu.com.tw', '2004-03-24 00:00:00', 0000, 16, 0, 3, '', '', 552, '', 'KS (Kevin Su)', '', 'KS (Kevin Su)', '凱斯音樂', '', 0, 1, 0, '2008-12-24 06:31:50', '2015-03-12 13:35:59', '0000-00-00 00:00:00'),
